import { Button, Tooltip } from 'antd';
import { SearchOutlined } from '@ant-design/icons';

export default class Search extends PureComponent {

    render() {
        return (
            <Tooltip title="search">
                <Button shape="circle" icon={<SearchOutlined />} />
            </Tooltip>
        );
    }
}
